import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const [stats, setStats] = useState({
    employeeCount: 0,
    projectCount: 0,
    countryCount: 0,
    recentEmployees: []
  });

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const res = await axios.get('http://localhost:5001/api/dashboard/stats', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`
          }
        });
        setStats(res.data);
      } catch (err) {
        console.error('Chyba pri načítaní dashboard dát:', err);
      }
    };

    fetchStats();
  }, []);

  return (
    <Container className="mt-5 text-white">
      <h2 className="text-center mb-4">Vitaj späť, Maťo!</h2>
      <p className="text-center">{new Date().toLocaleDateString('sk-SK')} o {new Date().toLocaleTimeString('sk-SK')}</p>

      <Row className="mb-4 text-center">
        <Col md={3}>
          <Card className="shadow glass-card text-white">
            <Card.Body>
              <div style={{ fontSize: '2rem' }}>👷</div>
              <h4>{stats.employeeCount}</h4>
              <p>Zamestnanci</p>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="shadow glass-card text-white">
            <Card.Body>
              <div style={{ fontSize: '2rem' }}>📁</div>
              <h4>{stats.projectCount}</h4>
              <p>Projekty</p>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="shadow glass-card text-white">
            <Card.Body>
              <div style={{ fontSize: '2rem' }}>🌍</div>
              <h4>{stats.countryCount}</h4>
              <p>Krajiny</p>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="shadow glass-card text-white">
            <Card.Body>
              <div style={{ fontSize: '2rem' }}>⏳</div>
              <h4>0</h4>
              <p>Dnes na smene</p>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      <Row className="mb-4">
        <Col md={6}>
          <Button as={Link} to="/add" variant="outline-light" className="w-100">
            + Pridať zamestnanca
          </Button>
        </Col>
        <Col md={6}>
          <Button as={Link} to="/projects" variant="outline-light" className="w-100">
            📂 Prehľad projektov
          </Button>
        </Col>
      </Row>

      <Card className="bg-dark text-white">
        <Card.Body>
          <Card.Title className="mb-3">⚠️ Poslední zamestnanci</Card.Title>
          {stats.recentEmployees.length > 0 ? (
            <ul>
              {stats.recentEmployees.map((emp, index) => (
                <li key={index}>
                  {emp.firstName} {emp.lastName} • {new Date(emp.createdAt).toLocaleDateString('sk-SK')}
                </li>
              ))}
            </ul>
          ) : (
            <p>Žiadni noví zamestnanci</p>
          )}
        </Card.Body>
      </Card>
    </Container>
  );
};

export default Dashboard;
